var wikk_params = ( function() {var VERSION = "1.0.0";var ARGV = {}; function getURLParameters(){var sURL = window.document.URL.toString();if (sURL.indexOf("?") > 0){var arrParams = sURL.split("?");var arrURLParams = arrParams[1].split("&");var i = 0;for (i = 0; i<arrURLParams.length; i++){var sParam =  arrURLParams[i].split("=");key = unescape(sParam[0]);value = sParam[1];if(ARGV[key] == null)ARGV[key] = value;else if(typeof ARGV[key] === 'string')ARGV[key] = [ ARGV[key], value ];elseARGV[key].push(value);}}}return {getURLParameters: getURLParameters,ARGV: ARGV,VERSION: VERSION}})();